import React from 'react';
import "../card.css";
import data from "../data.json";




export default function Card() {
  return (
   data.Vagas.map((dados) => {
      return (
        
 <div className="container" >
      <div className='card card1'key={dados.id}>
        <img src={dados[0].logo} alt="minha imagem" />
        <div className='descript-left'>
          <div className="descript-cabecalho">
                <span>{data[0].company}</span> <span>{data[0].new}</span> <span>{data[0].featured}</span>
          </div>

          <div className="title">
            <h4>{data[0].position}</h4>
          </div>

          <div className='descript-footer'>
            <span>{data[0].postedAt + " - "}</span> <span>{data[0].contract + " - "}</span> <span>{data[0].location }</span>
          </div>

        </div>

        <div className='descript-right'>
          <span>{data[0].role}</span>  <span>{data[0].level}</span>  <span>{data[0].languages}</span>
        </div>

      </div >

    </div>
      )
    })
   
  );
}
